import Image from '../../components/Image/Image'

const Clients = ({className, data}) => {
  const {lightThemeClients, darkThemeClients} = data

  return (
    <section>
      {lightThemeClients.lenth && (
        lightThemeClients.map(client => 
          <Image 
            dataType={className} 
            image={client} 
            key={client.source}
          />
        )
      )}
    </section>      
  )
}

export default Clients
